import React from 'react';

const Footer = () =>{
    const year = new Date().getFullYear();
    return (
        <>
        <footer style={{position: "fixed", bottom:"0px"}}>
            <p className="text-center">Copyright ©️ {year} </p>
        </footer>
        </>
    )
}
export default Footer;
